%[text] # テスト
%[text] ## 初期値
a=1;
vl=VirtualLink;
%[text] ##  テスト
%% test1
a=a+1;
assert(a==2);
%[text] test2は連続的に実行すると失敗するが，独立に実施すると通る．
%% test2
a=a+2;
assert(a==3); %[output:9ac0eb2e]
%%
%[text] ## Disk of spine
%%
%[text] ## abalone disk
vl.setData(GaussCode={[1,-1]},orientation=1)
tbl=vl.getDiskTable;
weight=-(tbl.delta\tbl.cp)' %[output:97dae174]
%%

%% negative abalone disk 
vl.setData(GaussCode={[1,-1]},orientation=-1)
tbl=vl.getDiskTable;
weight=-(tbl.delta\tbl.cp)'
%%

%% abalone knot compl
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.convertKnotCompl;
tbl=vl.getDiskTable;
weight=-(tbl.delta\tbl.cp)'
tbl.delta*weight'+tbl.cp
dx=tbl.delta;
dx=dx(:,[1,3,5,7])
dx*[0;1;1;-1]+tbl.cp
%%
%% abalone knot complement and add loop
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.convertKnotCompl;
[gc,ori]=vl.getGaussCode;
gc{1}(end+1)=-5;
gc{3}=[5];
ori(end+1)=1;
vl.setData(GaussCode=gc,orientation=ori)
% tbl=vl.getDiskTable;
vl.calcWeight
%%
%% plot abalone
vl.setData(GaussCode={[1,-1]},orientation=-1)
vl.plot %[output:415d84b4] %[output:6ce88b17]
vl.plotSage %[output:391fdd32]
%%
vl.setData(RGaussCode={[1,-1]},orientation=1)
vl.plot
vl.plotSage
%%
%% trefoil
vl.setData(table=[3,1])
vl.plot
vl.plotSage
vl.plot(virtual=false)
%%

vl.setData(PD=[1, 2, 4, 3; 3, 4, 6, 5; 5, 6, 2, 1]);
vl.plot
%[text] ![](text:image:0cef)
%%
vl.setData(GaussCode={[1,-1,-3,3,-2,2]},orientation=[-1,0,1])
vl.plot
%[text] 
pd=vl.getPDCode
[gc,ori]=vl.getRGaussCode
vl.getRPDCode
vl.setData(PDCode=pd+1)
[gc,ori]=vl.getGaussCode
vl.plot

%%
%[text] ## from table
close all
vl.setData(table=[7,4])
vl.plot

%%
%% plot Virtual Link
vl.setData(Gauss={[1,3,-3,-2],[-1,2]},ori=[1,0,1])
vl.plot(virtual=false,bendingNumbers={[1,2,-3,0,3,1]})
%%
%[text] ## plot weighted virtual link
vl=VirtualLink %[output:6df19ca2]
vl.setData(RGauss={[1,2,-2],[-1]},ori=[1,1])
vl.plot %[output:5df0c278]
vl.setData(RGauss={[1,2,-2,0],[-1]},ori=[1,1]) %[output:9d310030]
vl.plot
%%
%% plot Lens space 2 1
vl.setData(GaussCode={[1,-3,2,-2,3,-1]},orientation=[1,1,0])
vl.setWeight([0,1,-1,-1])
vl.plot(virtual=false,bendingNumbers={[3,-1,1,-3,1,-1]}) %[output:75bfdd4a]
%[text] ![](text:image:33f8)
vl.plot(bendingNumbers={[3,-1,1,-3,1,-1]}) %[output:5bab6c10]
%%
%% plot abalone with weight
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.setWeight([1,-2])
vl.plot
%%
%% calc weight of L 2 1
vl.setData(GaussCode={[1,-3,2,-2,3,-1]},orientation=[1,1,0])
vl.calcWeight
vl.getMatrixHMove'
%%
vl.setData(GaussCode={[1,-1]},orientation=1)
vl.convertKnotCompl
vl
vl.plot(virtual=false)
vl.calcWeight
%%
vl=VirtualLink
vl.setData(RG={[1,2,-2,-3,-5],[-4,-1,3,4],[5]},ori=[-1,1,-1,1,1])
vl.plot
